      "date": "1731-01-02",
      "tags_section": "Es werden zum Verkauff offerirt:",
      "ntokens": 14,
      "text": "1. Ein Gulden der Fursten / 2. Ein Englischer Carolin foll not / sambt anderen von Minsorten."
    },
    {
      "date": "1731-01-02",
      "tags_section": "Es werden zum Verkauff offerirt:",
      "ntokens": 6,
      "text": "3. Psalmen-Bücher in Franckfurt."
    },
    {
      "date": "1731-01-02", 
      "tags_section": "Es werden zum Verkauff offerirt:",
      "ntokens": 29,
      "text": "4. Crystallin - Laternen von unterschiedlichen Sorten/ als : Leichte/ starckgehende/ nach der schönste und neuesten façon/ mit Cristallen-Glass und andern Gemahlden geziert/ wie auch Laternen Thürn und Kugeln."
    },
    {
      "date": "1731-01-02",
      "tags_section": "Es werden zu entlehnen begehrt:",
      "ntokens": 44,
      "text": "1. Ein Capital von 1000. Pfunden auff unterschiedsiche Realitæten in der Chur-Stadt auf 5. Jahr gegen 100. Gulden Interesse/ ohne fernere provision 2. Ein Capital von 1500. gl. dito von 600. Gulden baar."
    },
    {
      "date": "1731-01-02",
      "tags_section": "Bücher und zu entlehnen begehrt:",
      "ntokens": 41,
      "text": "1. Ein Behr-Mantel mit einen grünen Kragen 2. Ein französischer rother Carsol/ wenig gebraucht/ beyde in einen sehr considerable Preiss sich befindend/ auch ganz neu/sambt einem Deut von guten Leder/ zu haben in Nürnberg in der obern Schmid-Gassen."
    },
    {
      "date": "1731-01-02",
      "tags_section": "Gejuncken - und verlohrene Sachen:",
      "ntokens": 17,
      "text": "1. Ohngefehr ein 20. December ist aus einer Behausung von Leder abgegangen worden :"
    },
    {
      "date": "1731-01-02",
      "tags_section": "Zu vermiethen:",
      "ntokens": 26,
      "text": "1. In der Stadt Zeit vermuthlich letztern Weinmonat ein schon zimlich wohl meublirtes Zimmer zu offeriren Dienstern mit Geist/ englisch Bettung/ von 1. person 1. Gulden und 30. xr. in Kost"
    }
  ]
}
